import React, { Component } from 'react';
import ViewObject from "../../util/ViewObject";
import TableCell from "@mui/material/TableCell";
import TableRow from "@mui/material/TableRow";
import {JSONtoStringifyYAML} from "../../util/util";


const AlluxioCluster = ({ name, originalJSON, handleSendRequest }) => {
    const specJSON = originalJSON['alluxio-cluster-config']['spec'];
    const statusJSON = originalJSON['status'];

    return (
        <TableRow
            key={state.name}
            sx={{'&:last-child td, &:last-child th': {border: 0}}}
        >
            <TableCell>{state.name}</TableCell>
            <TableCell component="th" scope="row">{state.statusJSON.phase}</TableCell>
            <TableCell align="right">
                <ViewObject
                    objectKind='AlluxioCluster'
                    objectName={state.name}
                    objectConfigString={JSONtoStringifyYAML(state.specJSON)}
                    objectStatusString={JSONtoStringifyYAML(state.statusJSON)}
                    handleSendRequest={handleSendRequest}
                />
            </TableCell>
        </TableRow>
    );
}

export default AlluxioCluster
